// 3ra pagina creada:
import React from 'react'

import {
  IonContent,
  IonHeader,
  IonPage,
  IonTitle,
  IonToolbar,
} from '@ionic/react'

const TodosObjetivos: React.FC = () => {
  return (
    <IonPage>

      <IonHeader>
        <IonToolbar color="primary">
        </IonToolbar>
      </IonHeader>

      <IonContent>
        <h2>Pagina de Todos los Objetivos</h2>
      </IonContent>

    </IonPage>
  )
}

export default TodosObjetivos

// "IonHeader" para la toolbar y "IonContent" para el contenido de la pagina
